import passwordGenerator from "../img/passwordGenerator.png";
import weatherApp from "../img/weatherApp.png";

function Contact(props) {
  return (
    <div>
      <h1>my work</h1>
      <a href="https://gentle-brook-68093.herokuapp.com/view" target="_blank">
